import React from 'react';
import Navigationvar from './Navigationvar';

export default function Home() {
  return (
    <div>
      <Navigationvar />
      
      <div class="container">
  <div class="row">
    <div class="col">
    <p style={{ fontSize: '40px' }}>Enriching Lives Through Compassionate 
            In-Home Healthcare and Long-Term Facility 
            Senior Care</p>
    </div>
    <div class="col">
      <img src="/istockphoto-1399124556-612x612.jpg" style={{ width: '50%', height: 'auto' }}/>
    </div>
  </div>
  
</div>
        
      </div>
   
  );
}
